import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 812 });

    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to open and take screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Navigate to Electronics category
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for navigation to complete and take screenshot
    await page.waitForTimeout(1000); // Brief pause for navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics.png'));

    // Navigate back to mobile menu
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Navigate to Books category
    await page.waitForSelector('a:has-text("Books")', { timeout: 5000 });
    await page.click('a:has-text("Books")');

    // Wait for navigation to complete and take screenshot
    await page.waitForTimeout(1000); // Brief pause for navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_books.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_books.png'));

    // Close mobile menu
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });
    await page.click('.close-mobile-menu');

    // Wait for menu to close and take final screenshot
    await page.waitForSelector('#mobileMenuOverlay:not(.show)', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_menu_closed.png'));

    // Extract navigation data
    const extractedData = {
      menuItems: await page.$$eval('a', links => 
        links.map(link => link.textContent.trim()).filter(text => text.length > 0)
      )
    };

    return {
      success: true,
      action: "Successfully tested mobile menu navigation by opening menu, navigating to Electronics and Books categories, and closing menu",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
